import React from 'react';
import ButtonBase from '@mui/material/ButtonBase';
import './Tile.css';
import birdhouse from './images/birdhouse.png';

const Tile = (props) => {
    const isFolder = props.isFolder;
    let icon;

    if(isFolder) {

    } else {
        icon = <img className='tileFolderOverlap' src='https://img.icons8.com/fluency/96/000000/folder.png' alt="" />;
    }

    return(
        <div className="Tile">
            <ButtonBase>
                <div className='tileContent'>

                <img className='tileIconOverlap' src={'https://img.icons8.com/fluency/96/000000/'+props.image+'.png'} />
                    <div classname='tileOverlap'>
                        <img className='tileIconOverlap' src={'https://img.icons8.com/fluency/96/000000/'+props.image+'.png'} />
                        <img className='tileFolderOverlap' src='https://img.icons8.com/fluency/96/000000/folder.png' alt="" />
                    </div>

                    <p>{props.name || 'Untitled'}</p>
                </div>
            </ButtonBase>
        </div>
    );
}

export default Tile;
